import React, { Component } from 'react';
import Button from 'react-bootstrap/Button'
import {Link} from 'react-router-dom'

class HeaderNav extends Component {
    constructor(props){
        super(props);
    }

    render(){
        return (
            <div style={{color:'white', marginTop:"7vh", textAlign:"center", justifyContent:"center", alignItems:"center"}}>
                <Button variant="Link" style={{color:"white"}}>
                    <Link to="/home/" style={{color:"white"}}>Home</Link>
                </Button>
                <Button variant="Link" style={{color:"white"}}>
                    <Link to="/works/" style={{color:"white"}}>Works</Link>
                </Button>
                <Button variant="Link" style={{color:"white"}}>
                    <Link to="/resume/" style={{color:"white"}}>Resume</Link>
                </Button>
            </div>
        );
    }
};

export default HeaderNav;
